    function getContainWhitespacePercent(domNode) {
        if(!(domNode instanceof HTMLImageElement)) {
            return {
                horizontal: 0,
                vertical: 0,
            }
        }
        const nw = domNode.naturalWidth;
        const nh = domNode.naturalHeight;

        const cw = domNode.clientWidth;
        const ch = domNode.clientHeight;

        if (!nw || !nh || !cw || !ch) {
            return { horizontal: 0, vertical: 0 };
        }

        const ratioImg = nw / nh;
        const ratioBox = cw / ch;

        let horizontalPercent = 0;
        let verticalPercent = 0;

        if (ratioBox < ratioImg) {
            const scale = cw / nw;
            const displayedH = nh * scale;
            const diff = ch - displayedH;
            verticalPercent = (diff / ch) * 100;
            horizontalPercent = 0;
        } else if (ratioBox > ratioImg) {
            const scale = ch / nh;
            const displayedW = nw * scale;
            const diff = cw - displayedW;
            horizontalPercent = (diff / cw) * 100;
            verticalPercent = 0;
        } else {
            horizontalPercent = 0;
            verticalPercent = 0;
        }

        return {
            horizontal: horizontalPercent,
            vertical: verticalPercent,
        };
    }

    const ctaImageRelativeElement = document.querySelector('[data-component-type=background-image]') || document.querySelector('#endcard-root');
    const backgroundImageWidth = ctaImageRelativeElement.clientWidth;
    const backgroundImageHeight = ctaImageRelativeElement.clientHeight;
    const ctaImage = document.querySelector('[data-left-offset]');

    if(!ctaImageRelativeElement || !ctaImage) return;

    const containWhitespacePercent = getContainWhitespacePercent(ctaImageRelativeElement);

    const backgroundImageLeftOffset = (backgroundImageWidth * containWhitespacePercent.horizontal / 2) / 100;
    const backgroundImageTopOffset = (backgroundImageHeight * containWhitespacePercent.vertical / 2) / 100;
    const backgroundImageVisiblePartWidth = backgroundImageWidth - (backgroundImageWidth * containWhitespacePercent.horizontal) / 100;
    const backgroundImageVisiblePartHeight = backgroundImageHeight - (backgroundImageHeight * containWhitespacePercent.vertical) / 100;
    const ctaImageLeftCssPropertyValue = backgroundImageLeftOffset + (backgroundImageVisiblePartWidth * Number(ctaImage.getAttribute('data-left-offset'))) / 100
    const ctaImageTopCssPropertyValue = backgroundImageTopOffset + (backgroundImageVisiblePartHeight * Number(ctaImage.getAttribute('data-top-offset'))) / 100

    ctaImage.style.left = `${ctaImageLeftCssPropertyValue}px`;
    ctaImage.style.top = `${ctaImageTopCssPropertyValue}px`;
    ctaImage.style.width = `${backgroundImageVisiblePartWidth * Number(ctaImage.getAttribute('data-width')) / 100}px`;
    ctaImage.style.height = `${backgroundImageVisiblePartHeight * (Number(ctaImage.getAttribute('data-height'))) / 100}px`;
}

if(!document.querySelector('.gjs-dashed')) {
    window.addEventListener('DOMContentLoaded', adjustCtaPosition);
